angular.module('myfilter', ['ngSanitize'])
	.controller('myController', ['$rootScope','$scope','$filter', appsCtrl])
	.filter('unitFormat',['$filter',function($filter){
		return function(input,param){
			input = input || 0;
			var str = '';
			if(param == '亿元'){
				str = $filter('number')(input/100000000,2);
			}else{
				str = $filter('number')(input,2);
			}
			// console.log(param);
			return str;
		}
	}]);

